(41683, 'zhCN', '获得卡兹阿加的所有战斗宠物。', '卡兹阿加猎人', '宠物：蜡芯', 58238),
(18384, 'zhCN', '在幼鳞日托所完成下列任务，帮忙照顾雏龙。', '小雏龙最可爱了', '宠物：阿克赛尔', 58238),
(18383, 'zhCN', '在幼鳞日托所照顾五只刚孵出来的雏龙，满足他们的需要。', '保姆保姆！', '头衔：雏龙看护者', 58238),
(16731, 'zhCN', '收集下列所有战斗宠物。', '宫廷启幕', '头衔：菲泽斯沃斯的骑士', 58238),
(13469, 'zhCN', '在魔古山宝库、永春台和恐惧之心中收集下列所有战斗宠物。', '缰绳来袭VI：熊猫人之萌', '宠物：欢欢', 58238),
(12079, 'zhCN', '从暮光堡垒、黑翼血环、风神王座、火焰之地和巨龙之魂中收集下列所有战斗宠物。', '缰绳来袭V：萌物的裂变', '宠物：毁灭混合体', 58238),
(11320, 'zhCN', '在奥杜尔、十字军的试炼和冰冠堡垒中收集下列所有战斗宠物。', '缰绳来袭IV：巫妖汪之怒', '奖励：星界邀请函', 58238),
(9824, 'zhCN', '在黑暗神殿，海加尔峰和太阳之井中收集下列所有战斗宠物。', '缰绳来袭III：畅饮太阳之井', '宠物：库特', 58238),
(8519, 'zhCN', '获得全部四个至尊天神宠物。', '天神家族', '', 58238),
(8397, 'zhCN', '获得下列猫中的20种。', '爱猫成狂', '头衔：猫咪公主/王子', 58238),
(8293, 'zhCN', '在卡拉赞、毒蛇神殿和风暴要塞中收集下列所有战斗宠物。', '缰绳来袭II：钥匙的远征', '宠物：托托', 58238),
(7934, 'zhCN', '在经典团队副本中收集下列战斗宠物。', '缰绳来袭', '宠物：比格沃斯先生', 58238),
(40956, 'zhCN', '完成下列成就，帮助赞达拉和库尔提拉斯。', '登岛时光', '坐骑奖励：蜜背巢母', 58238),
(41201, 'zhCN', '完成下列成就，（暂时）终结萨拉塔斯的阴谋。', '疑影重重', '坐骑奖励：疑之影', 58238),
(40939, 'zhCN', '在“地心之战”第1赛季中，在身上的每一个装备栏中都装备一件物品等级不低于636级的物品。', '鎏金先驱', '', 58238),
