INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(278296, 'zhCN', '<马默杜克充满期待地看着你。>', '', 58238),
(278176, 'zhCN', '<马默杜克充满期待地看着你。>', '', 58238),
(11145, 'zhCN', '', '这个时代的星辰划出了新的轨迹，希望和力量的信标将会引领未来。', 58238),
(279769, 'zhCN', '重返天际的感觉棒极了！\n\n自从和卡贝克拉一起罢工后就觉得浑身不对劲。那些承包商连她的工资都不发！于是紫色公主号就停业了。我们暂时各奔东西。\n\n但现在我们回来了，准备重返云霄！哈哈！\n\n除了杜恩纳。她害怕邦图拉克，这我不怪她。\n\n我们正驶入风暴，但杉苟会在暴风中守护我们！', '', 58238),
(279768, 'zhCN', '', '你要去海妖岛？\n\n<杜恩纳露出獠牙做了个厌恶的表情并啐了一口。>\n\n我告诉过卡贝克拉这是个凶兆。我听过海妖的传说。在赞达拉语中，我们称它们为“邦图拉克”。死亡歌者。可憎的生物。\n\n我很幸运，这些年在海上飞行从未遇见过它们。但现在我们却要去一个以它们命名的地方？\n\n<杜恩纳躬身摇头。>\n\n愿风暴之神杉苟指引我们。', 58238),
(279747, 'zhCN', '糟糕的是一无所获。我派了最精锐的手下去探查。\n\n但他们只找到几个伯拉勒斯的传说，还有一个古老的库尔提拉斯寓言，警告人们要提防什么“召唤”。鬼知道那是啥。\n\n而且连张像样的海图都没找到。看来大伙都躲着这地方，不过我觉得这反而是个机会！\n\n多亏莉吉特和地勤队给了充足的数据，不然我们都找不到回去的路。', '', 58238),
(278425, 'zhCN', '你和半个卡兹阿加的人都想知道吧！\n\n先是阿拉希人和土灵来打听，然后没多久他们就登上飞船，开着钻机走了！\n\n哦，要是我还有火箭钻头的联系人，我们肯定能更快到那儿！\n\n不过，行吧，你想知道吗？\n\n我们正前往海妖岛。你听说过那儿吗？', '', 58238),
(273289, 'zhCN', '嘿，欢迎入伙！土灵和阿拉希人已经上岛了，我们得赶紧跟上去！', '', 58238),
(273102, 'zhCN', '瞧！我们迟到了。快跟我到下面去。当心脚下！呵呵呵。', '', 58238);
